import React from "react";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@mui/material";
const urlArray = [
  " https://tunatheme.com/tf/html/broccoli-preview/broccoli/img/icons/icon-img/category-2.png",
  "https://tunatheme.com/tf/html/broccoli-preview/broccoli/img/icons/icon-img/category-3.png",
  "https://tunatheme.com/tf/html/broccoli-preview/broccoli/img/icons/icon-img/category-4.png",
];

const Bannerscomponent1 = () => {
  return (
    <Box>
      {
        urlArray.map(e=>
          <Card>
            <CardMedia
              component="img"
              alt="This is product"
              className="imageCard"
              image={e}
            />
          </Card>
        )
      }
    </Box>
  );
};

export default Bannerscomponent1;
